import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import Header from './Header';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <div className='container'>
      <Header/>
    <App />
    </div>
  </React.StrictMode>
);
